Ulf,

Yes, you need the DUPLICATE statement.  You can either add it to the 
Chemkin-format input file, or to the CTI file ck2cti produces.  Cantera 
is a bit stricter in syntax in some ways than Chemkin.  For example, 
Cantera also flags reactions like

A + B &lt;=&gt; AB
AB &lt;=&gt; A + B

as duplicates, but last time I checked (which was a long time ago) 
Chemkin allowed these without a DUPLICATE keyword.  This did not change 
in version 1.5.5; I think it goes back to at least version 1.5.0, so 
perhaps you were using an older version of ck2cti.exe.

Dave



